That torrent already contains the whole run of Cable v2, however this is an upgrade of all issues to digital. If you download both, simply skip those issues in the prior torrent or delete them as necessary. I have labeled the folders clearly in the Messiah Trilogy torrent so you can easily slot in this upgrade.

The plot follows Cable after he secures Hope, and their adventures in time while being hunted down by various factions (including Bishop). Also crosses over with X-Force for the second part, Messiah War. The last issue takes place right before Second Coming, and is renamed to Deadpool &amp; Cable. All thanks to G85-Empire for the scans, please seed and enjoy! :-)
